import React, { useEffect, useState } from 'react'
import Sidebar from '../comman/Sidebar';
import Header from '../comman/Header';
import { registerAgent } from '../../api';

function AddBankDetail() {
    const [formData, setFormData] = useState({
        bankName: '',
        branchName: '',
        accountholderName: '',
        accountNo: '',
        ifscCode: '',  // Added password field
    });

    // const [errors, setErrors] = useState({
    //     userName: '',
    //     firstName: '',
    //     lastName: '',
    //     phoneNo: '',
    //     password: '',  // Added password field
    // });

    // const validateForm = () => {
    //     let valid = true;
    //     const newErrors = { ...errors };

    //     // Validate user name
    //     if (formData.userName.trim() === '') {
    //         newErrors.userName = 'User name is required';
    //         valid = false;
    //     } else {
    //         newErrors.userName = '';
    //     }

    //     // Validate firstname
    //     if (formData.firstName.trim() === '') {
    //         newErrors.firstName = 'First name is required';
    //         valid = false;
    //     } else {
    //         newErrors.firstName = '';
    //     }

    //     // Validate last name
    //     if (formData.lastName.trim() === '') {
    //         newErrors.lastName = 'Last name is required';
    //         valid = false;
    //     } else {
    //         newErrors.lastName = '';
    //     }

    //     // Validate phone number
    //     if (formData.phoneNo.trim() === '') {
    //         newErrors.phoneNo = 'Phone number is required';
    //         valid = false;
    //     } else {
    //         newErrors.phoneNo = '';
    //     }

    //     // Validate password
    //     if (formData.password.trim() === '') {
    //         newErrors.password = 'Password is required';
    //         valid = false;
    //     } else {
    //         newErrors.password = '';
    //     }

    //     setErrors(newErrors);
    //     return valid;
    // };

    const handleSubmit = (event) => {
        // event.preventDefault();
        // if (validateForm()) {
        //     // Proceed with form submission
        //     handleRegister();
        //     console.log('Form submitted:', formData);
        // } else {
        //     console.log('Form has validation errors');
        // }
    };

    const handleChange = (event) => {
        const { name, value } = event.target;
        setFormData({ ...formData, [name]: value });
    };

    const handleRegister = async () => {
        try {
            const result = await registerAgent(formData);
            console.log(result);
        } catch (error) {
            console.error('Error during registration:', error.message);
        }
    };

    return (
        <div>
            <body id="page-top">
                <div id="wrapper">
                    <Sidebar />
                    <div id="content-wrapper" className="d-flex flex-column">
                        <div id="content">
                            <Header />
                            <div className="container-fluid">
                                <div className="d-sm-flex align-items-center justify-content-between mb-4">
                                    <h1 className="h3 mb-0 text-gray-800">Add Bank Detail</h1>
                                </div>
                                <div className="row">
                                    <div className='col-lg-12 mb-4'>
                                        <form className="login-form" onSubmit={handleSubmit}>
                                            <div className="form-outline mb-4">
                                                <label className="form-label" htmlFor="formUserName">Bank Name</label>
                                                <input
                                                    type="text"
                                                    id="formBankName"
                                                    className={`form-control form-control-lg`}
                                                    placeholder="Enter a bank name"
                                                    name="bankName"
                                                    value={formData.bankName}
                                                    onChange={handleChange}
                                                />
                                                {/* {errors.userName && <div className="invalid-feedback">{errors.userName}</div>} */}
                                            </div>
                                            <div className="form-outline mb-4">
                                                <label className="form-label" htmlFor="formFirstName">Branch Name</label>
                                                <input
                                                    type="text"
                                                    id="formBrtanchName"
                                                    className={`form-control form-control-lg`}
                                                    placeholder="Enter a branch name"
                                                    name="branchName"
                                                    value={formData.branchName}
                                                    onChange={handleChange}
                                                />
                                                {/* {errors.firstName && <div className="invalid-feedback">{errors.firstName}</div>} */}
                                            </div>
                                            <div className="form-outline mb-4">
                                                <label className="form-label" htmlFor="formLastName">Account Holder Name</label>
                                                <input
                                                    type="text"
                                                    id="formAccountHolderName"
                                                    className={`form-control form-control-lg`}
                                                    placeholder="Enter a account holder name"
                                                    name="accountholderName"
                                                    value={formData.accountholderName}
                                                    onChange={handleChange}
                                                />
                                                {/* {errors.lastName && <div className="invalid-feedback">{errors.lastName}</div>} */}
                                            </div>
                                            <div className="form-outline mb-4">
                                                <label className="form-label" htmlFor="formPhoneNo">Bank Account No.</label>
                                                <input
                                                    type="text"
                                                    id="formPhoneNo"
                                                    className={`form-control form-control-lg`}
                                                    placeholder="Enter a bank account no."
                                                    name="phoneNo"
                                                    value={formData.phoneNo}
                                                    onChange={handleChange}
                                                />
                                                {/* {errors.phoneNo && <div className="invalid-feedback">{errors.phoneNo}</div>} */}
                                            </div>
                                            <div className="form-outline mb-4">
                                                <label className="form-label" htmlFor="formPassword">Ifsc code</label>
                                                <input
                                                    type="text"
                                                    id="formIfscCode"
                                                    className={`form-control form-control-lg`}
                                                    placeholder="Enter a ifsc code"
                                                    name="ifscCode"
                                                    value={formData.ifscCode}
                                                    onChange={handleChange}
                                                />
                                                {/* {errors.password && <div className="invalid-feedback">{errors.password}</div>} */}
                                            </div>
                                            <div className="form-outline mb-4">
                                                <label className="form-label" htmlFor="formPassword">Qr code</label>
                                                <input
                                                    type="file"
                                                    id="formQrCode"
                                                    className={`form-control form-control-lg`}
                                                    placeholder="Enter a qr code"
                                                    name="ifscCode"
                                                    value={formData.Code}
                                                    onChange={handleChange}
                                                />
                                                {/* {errors.password && <div className="invalid-feedback">{errors.password}</div>} */}
                                            </div>
                                            <div className="text-center text-lg-start mt-4 pt-2">
                                                <button type="submit" className="btn btn-primary btn-lg">Proceed</button>
                                            </div>
                                        </form>
                                    </div>
                                </div>
                            </div>
                        </div>
                        <footer className="sticky-footer bg-white">
                            <div className="container my-auto">
                                <div className="copyright text-center my-auto">
                                    <span>Copyright &copy; Your Website 2023</span>
                                </div>
                            </div>
                        </footer>
                    </div>
                </div>
                <a className="scroll-to-top rounded" href="#page-top">
                    <i className="fas fa-angle-up"></i>
                </a>
            </body>
        </div>
    )
}

export default AddBankDetail
